('Analytics (TBC) ',6000,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','The project aims to explain the analytics on how does the people sell and buy the pre-loved items. Main feature is to allow individual to search pre-loved products across multiple sites and to consolidate, rank and compare for the closest match of the desired product. Sellers of the pre-loved goods shall use the analytic arising from the single consolidated venue for searching the pre-loved items, thus helping them to decide on the optimal price before it can posted for sale. Buyers will have the opportunity to compare the price from various products before they can buy it from the market place.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
