('Sailing the uncertain outlook: Customer Satisfaction Analysis in the Singapore Hotel Industry ',6001,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','This project aims to analyze and find out the important factors (e.g. value for money, price,Location) of hotels which affect customer satisfaction. The data will be crawled and collected from the hotel booking website. Data will be analyzed and generate result using Tableau. The result will provide valuable insights to customers mainly visitors with family to help them source for their suitable hotels based on their needs, In addition, with the ability of the knowing the correlation of factors, the result will provide hotel management with a platform to better understand behavior and preferences of customers. ','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
