INSERT INTO `project` (`title`, `project_id`,`module_id`,`abstract`,`poster`,`video`) VALUES 
('Mobile Food in Fighting for Crime ',6002,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','A new generation of street-food lovers is lining up at food trucks/carts like never before. They are the latest trend in American and world culture. Street-food industry has never been in limelight making it an untapped area of research. In today’s world, pressure of “giving more with less” has made simple and efficient lifestyles in ever increasing demand. People are seeking inexpensive and convenience food for their breakfast, lunch, tea break, or dinner. These factors make the mobile-food concept more appealing than ever.Unknowingly, with the existence of mobile food, it is predicted to also help fight crime.Mobile food hawkers can become the ‘eye of the city’ along with doing their mobile food business.Contributing factors to boost mobile food existence will need to be investigated further. ','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
