('Analytics (TBC) ',6003,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Census data provides states with a unique insight into the various factors affecting their populace and plays a key role in policy and governing decisions. However census data besides being expensive and tedious to gather are also static and only provide a snapshot in time. We propose to supplement census data with information gathered in real time from social sensors to predict the real time population density for a given geographic region. State activities such as disaster management and planning, state surveillance, infrastructure planning may benefit from such an analysis. ','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
