INSERT INTO `project` (`title`, `project_id`,`module_id`,`abstract`,`poster`,`video`) VALUES 
('Analysis of Aviation Accidents ',6004,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','During past decades, airplane has become most popular means of long distance travel. While enjoying this kind of fastest common transportation, people start to raise the concern on the aviation safety. In this study, we will use text mining and propensity score matching etc. to analyze various aspects of aviation accidents, comparing with non-accidents. We will try to find some shared attributes, such as time, location and weather, impacts on the performance of airline companies and then provide recommendations. Our study will be useful for the general public as an education source. And this is also helpful for the industry to improve the safety conditions.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
