INSERT INTO `project` (`title`, `project_id`,`module_id`,`abstract`,`poster`,`video`) VALUES 
('Hire for a long Haul ',6005,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Hiring employees is simply a start to making a solid work force. High turnover costs entrepreneurs in time and workforce productivity. We all know, good employees are elusive and once you have pulled in a splendid individual from staff, it’s just as paramount to ascertain that he stays with the organization. Companies expect at least one thing from every candidate they hire: Will he/she sustain for a decent period of time? Our study proposes to analyze the applicant’s expected stay in an organization in a position amid the enlistment. The analysis would give an idea whether a candidate would stay with an organization for fleeting or long haul. These trends would eventually reduce a company’s sudden attrition rate and helps keep the manpower steady.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
