('Find Your Haven - A predictive analysis to find the safest place in United States',6006,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','The United States of America remains an admired place of choice for a remarkable number of people especially students and skilled professionals from all over the world to seek a better life. We intend to develop a suggestion system that would help in identifying suitable places to live in the United States. The primary objective involves analysing the accident, crime and disaster mishaps in United States which are filtered on the specifics of the individual’s profile and requirements. Scores are assigned based on statistical analysis of various factors such as age, alcoholic/non-alcoholic, gender, preferred area of residence, etc., The result of this analysis would suggest a prioritised list of places that are conducive to live in United States.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
