('Analytics (TBC) ',6008,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','As the peer-to-peer lending platforms are gaining popularity, individual investors are exposed to more and better investment opportunities rather than just savings in the banks. But these individual investors may not have the expertise to assess the risks associated with the loans. Our study proposes to build a prediction tool based on the historical loan data, and get some insights on what factors are affecting the default rate of the loans. It aims to predict good/bad investments based on both internal factors (personal info available on the peer-to-peer lending sites) and certain external factors (such as the macro economic conditions).','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
