('Targeted Marketing using Machine Learning ',6009,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Banks collect some key customer attributes like demographics, Income , previous loans and they also have some socio-economic features like employment rate. These are very valuable information and can be used to predict customer behavior using historical data. Here based on two years of data, we are trying to predict whether or not a customer would subscribe for a term deposit. This will be very much helpful for the term deposit marketing campaign. The main objective reduce the marketing cost by contacting the right customers instead of mass spamming all the customers. We will be using some machine learning techniques to predict the term deposit subscription probability.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
