('Behavior study of “whales” in gaming ',6010,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Gaming industry is very competitive. It is difficult to make addictive games and monetize them. In a fermium game model, it is estimated that only 10% of the gamers pay for features and less than 1% of gamers (known as Whales) contribute to more than 50% percent of the game revenue. Analyzing these whales will help the company to tap in more revenue. In this project we analyze the behavior of these Whales and using this analysis we try to find how we can make non-whale users to make more purchases.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
