('Wine Advisor ',6011,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Over the hundreds of kinds of wine, only a few match the food that you are planning for dinner. How do you know which one? Where to buy it? How to be sure you would even like it? We intend to solve this problem by offering an IT tool based on analytics that will help people match their wine with their food. The result will be a wine to buy but also in which supermarket and for what price. Moreover, based on thousands of consumer reviews and the user’s profile, we will suggest a wine that pleases him.','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
