('Skill Tree ',6012,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Skill Tree aims to help people evaluate themselves against the skill demand in the industry and understand the set of skills and experience required for their “dream jobs”. This is achieved by referencing multiple job sites and analyzing the job details to form a picture of career roles in the industry as well as the requirements and remuneration associated with the role. ?','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
