('Analytics (TBC) ',6013,'yyyyyyyy-yyyy-yyyy-yyyy-yyyyyyyyyyyy','Good eating is complicated. Everyday food may contain high calories or lack several nutritional value. Many people want to be able to eat healthy and achieve a balanced nutrition. We will like to help by building a food recommendation algorithm that acts as a personal coach that helps the user make the better decisions in terms of what food to eat next. This tool, while easy to use, is targeted at the general public - especially students and parents. We want to help people eat healthier by using data analytics to recommend foods to eat. ?','http://media.tumblr.com/3f81fad6ef163759fff8077580d94752/tumblr_inline_nj4nxkE0C21qersu1.png','https://www.youtube.com/watch?v=MYZfjfkwRII');
